import React from 'react';

import {Routes, Route} from 'react-router-dom';

import Loading from './Loading';
import Home from './Home';

import './App.css';

const App = () => {

  return (
    <div>
      <Routes>
        <Route exact path='/' render={() => <Home/>}/>
        <Route path='/loading' render={() => <Loading/>}/>
      </Routes>
    </div>
  )
};

export default App;
